import React from 'react';
import axios from 'axios';
import {Link} from 'react-router-dom';

class Home extends React.Component{
    state={
        patientData:[]
    }

    componentWillMount(){
        axios.get('http://localhost:8080/clinicalservices/api/patients').then(res=>{
            const patientData = res.data;
            this.setState({patientData})
        }).catch(error => console.log(error));
    }

    componentDidMount() {
        axios({
          method: "get",
          url: "http://localhost:8080/clinicalservices/api/patients",
          withCredentials: true,
          headers: {
            "Access-Control-Allow-Origin": "*",
            "Content-Type": "application/json",
            Accept: "application/json"
          }
        })
          .then(response => {
            if (response && response.data) {
              this.setState({ patient: response.data });
            }
          })
          .catch(error => console.log(error));
      }

    render(){
        return (<div>
            <h2>Patient:</h2>
            <table align='center'>
                <thead>
                <tr>
                    <th>Id</th>
                    <th>First Name</th>
                    <th>Last Name</th>
                    <th>Age</th>

                </tr>
                </thead>
                <tbody>
                    {this.state.patientData.map(patient=><RowCreator item={patient}/>)}
                </tbody>
            </table>
            <br/>
            <Link to={'/addPatient'}><font size="5">Register Patient</font></Link>
        </div>)
    }
}

class RowCreator extends React.Component{
    render(){
        var patient = this.props.item;
        return <tr>
            <td>{patient.id}</td>
            <td>{patient.firstName}</td>
            <td>{patient.lastName}</td>
            <td>{patient.age}</td>
            <td><Link to={'/patientDetails/'+patient.id}>Add Data</Link></td>
            <td><Link to={'/analyze/'+patient.id}>Analyze</Link></td>
            <td></td>

        </tr>
    }
}
export default Home;
